        e.preventDefault();
        setTodos([
            ...todos,{name:input,complete:false,id:uuid()}
        ])
    }

  return (
    <form onSubmit={onsubmit}>
        <input className="form-input" type="text" 
        placeholder='enter a todos'
        autoComplete='off'/>
